package cn.com.evo.integration.guangxi.content.dto;import javax.xml.bind.annotation.XmlAttribute;import javax.xml.bind.annotation.XmlRootElement;/** * @Description: * @author: lu.xin * @create: 2019-05-15 2:03 PM **/@XmlRootElement(name = "result")public class GxgdContentResponse {    /**     * 返回码     * 0 成功     * 1 失败     */    private String ret;    /**     * 错误码     */    private String code;    /**     * 返回信息     */    private String reason;    private String id;    /**     * 上下线失败时的错误信息     */    private String debug;    @XmlAttribute(name = "ret")    public String getRet() {        return ret;    }    @XmlAttribute(name = "code")    public String getCode() {        return code;    }    @XmlAttribute(name = "reason")    public String getReason() {        return reason;    }    @XmlAttribute(name = "id")    public String getId() {        return id;    }    @XmlAttribute(name = "debug")    public String getDebug() {        return debug;    }    public void setRet(String ret) {        this.ret = ret;    }    public void setCode(String code) {        this.code = code;    }    public void setReason(String reason) {        this.reason = reason;    }    public void setId(String id) {        this.id = id;    }    public void setDebug(String debug) {        this.debug = debug;    }    @Override    public String toString() {        return "GxgdContentResponse{" +                "ret='" + ret + '\'' +                ", code='" + code + '\'' +                ", reason='" + reason + '\'' +                ", id='" + id + '\'' +                ", debug='" + debug + '\'' +                '}';    }}